import React, {Component} from 'react'
import TableFixedHeader from './completeLog'

const Axios = require('axios')

class activityLayout extends Component{

    refresh = async() => {

        let plateObject = {
            plateNumber: '111113',
            location: 'Parking Lot'
        }

        let crosscheck = await Axios.post('/api/lpr/crosscheck', 
        {
            plateNumber: plateObject.plateNumber,
            location: plateObject.location
        })

        let data = crosscheck.data.type 
        let parent = crosscheck.parentName

        if(parent){
            console.log("Parent Plate")
        }
        else if(data){
            console.log("High Risk Plate")
        }
        else{
            console.log("Unrecognized")
        }
    }

    componentDidMount(){
        this.refresh()
    }

    render(){
        return(
        <div>
            <TableFixedHeader/>
        </div>
        )
    }
}

export default activityLayout
